import React from "react";

function Homepage() {

    return (
        <div className="container homepage mx-auto">
            <div className="row mx-5">
                <div className="col-6 mx-auto">
                    <h1 className="home">
                        Hello!
                    </h1>
                    <p className="homep">
                        My name is Samantha and I am a web developer.
                    </p>
                </div>
            </div>
        </div>
    )

}

export default Homepage;
